<script>
import CqZc from "./CqZc.vue";
export default {
  //import引入的组件需要注入到对象中才能使用
  name: "cqMapSvg",
  components: { CqZc },
  data() {
    //这里存放数据
    return {
      cqzc: false
      // showZC: false //主城区大图显示
    };
  },
  props: {
    showZC: Boolean,
    isMap: Boolean,
    county: {
      type: Array,
      default: () => null
    },
    shiGeoCoordMap: {
      type: Array,
      default: () => null
    }
  },
  created() {
    // console.log(this.shiGeoCoordMap);
    // this.init();
  },
  //监听属性 类似于data概念
  computed: {},
  //监控data中的数据变化
