    cqzc(r) {
      // console.log(r);
      // this.showZC = !this.showZC;
      // console.log('1212',r);
      this.$emit("update:showZC", false);
    }
    // shiGeoCoordMap(res) {
    // console.log("svg change:", this.shiGeoCoordMap);
    // }
  },
  // inject: ['foo'],
  //方法集合
  methods: {
    ycdt(a) {
      this.$emit("update:isMap", false);
      this.$parent.$emit("ycdt", a);
      // this.$emit("ycdt", a, b);
    },
    codeNmae(codeNmae, type, isMap) {
      //此处监听子组件比本身多isMap属性
      this.$emit("update:isMap", true);
      this.$parent.$emit("codeNmae", codeNmae, type);
      // this.$emit("codeNmae", codeNmae, type);
    },
    //暂时未使用
    init() {
      let isZC = false;
      this.county.map(item => {
        switch (item.CODE) {
          case "500103":
            isZC = true;
            break;
          case "500104":
            isZC = true;
            break;
          case "500105":
            isZC = true;
            break;
          case "500106":
            isZC = true;
            break;
          case "500107":
            isZC = true;
            break;
          case "500108":
            isZC = true;
            break;
          case "500109":
            isZC = true;
            break;
          case "500112":
            isZC = true;
            break;
          case "500113":
            isZC = true;
            break;
        }
      });
      if (isZC) {
        this.county.push({
          CODE: "88888888",
          ISENABLE: "88888888",
          MONEY: 88888888,
          NAME: "主城区",
          PERSON: 88888888,
          PERSONTIME: 88888888,
          PROJECTS: 88888888
        });
      }
    },
    isGray(code) {
      let re = true;
      this.county.forEach(item => {
        // eslint-disable-next-line eqeqeq
        if (item.CODE == code) {
          re = false;
        }
      });
      return !re;
    }
  }
};
